import React, { Component } from 'react'
import Square from './components/Square'
import './App.css'

class App extends Component{
  render(){
    return(
      <>
        <div id="body">
        <h1>Battleship App</h1>
        <Square />
        </div>
      </>
    )
  }
}
export default App
